import React from 'react';
import Card from './Card';
import Sdata from './Sdata';
import Menu from '.Menu';
function Icard(){
    return(
        <React.Fragment>
            <h1 className="heading_style">List of top 10 webseries in 2020</h1>
            <div className="card-wrapper">
                {Sdata.map((val , index) => {
                    console.log(index)
                    return(
                        <Card
                            key={val.id}
                            imgsrc={val.imgsrc}
                            title={val.title} 
                            sname={val.sname}     
                            links={val.links} 
                        />
                    );
                })}
            </div>
        </React.Fragment>
    )
}
export default Icard;
